ad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"744758","type":"CustomJS"},{"attributes":{},"id":"744554","type":"BasicTicker"},{"attributes":{},"id":"744364","type":"BasicTicker"},{"attributes":{"coordinates":null,"formatter":{"id":"744393"},"group":null,"major_label_policy":{"id":"744673"},"ticker":{"id":"744364"},"visible":false},"id":"744363","type":"LinearAxis"},{"attributes":{"factors":["0","1"],"palette":["rgb(178.5, 27.163043478260846, 0.0)","rgb(0.0, 178.5, 0.0)"]},"id":"744391","type":"CategoricalColorMapper"},{"attributes":{"axis":{"id":"744549"},"coordinates":null,"group":null,"ticker":null},"id":"744552","type":"Grid"},{"attributes":{},"id":"744547","type":"LinearScale"},{"attributes":{},"id":"744598","type":"LinearScale"},{"attributes":{"axis":{"id":"744407"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"744410","type":"Grid"},{"attributes":{"coordinates":null,"group":null},"id":"744819","type":"Title"},{"attributes":{"coordinates":null,"formatter":{"id":"744393"},"group":null,"major_label_policy":{"id":"
